        public static int MinDominoRotations(int[] tops, int[] bottoms)
        {
            int min = MinSwaps(tops, bottoms, tops[0]);
            if (min != -1 || tops[0] == bottoms[0]) return min;
            else return MinSwaps(tops, bottoms, bottoms[0]);
        }

        public static int MinSwaps(int[] a, int[] b, int val)
        {
            int aSwap, bSwap;
            aSwap = bSwap = 0;
            for(int i =0; i < a.Length; i++)
            {
                if (a[i] != val && b[i] != val)
                {
                    //Console.WriteLine("a[i] = {0}, b[i] = {1}, val = {2}, idx = {3}", a[i], b[i], val,i );
                    return -1;
                }
                else if (a[i] != val) aSwap++;
                else if (b[i] != val) bSwap++;
            }
            return Math.Min(aSwap, bSwap);
        }
    }
